// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract OwnerCheck {

    address owner = 0x5B38Da6a701c568545dCfcB03FcB875f56beddC4;
    uint256 myNumber = 10;

    function addTwoNumbers(uint256 _value) public {
        myNumber = myNumber + _value;
    }

    function getNumber() public onlyOwner view returns (uint256) {
        return myNumber;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "You're not a owner.");
        _;
    }



    



}

